import React from 'react'
import styled from 'styled-components'
import SocialBG from '../assets/CommunityBG.webp'
import Social1 from './Social/Social1'
import Social2 from './Social/Social2'
import Social3 from './Social/Social3'
import Social4 from './Social/Social4'

const Container = styled.section`
    padding: 6em;
    padding-right: 9em;
    display: flex;
    flex-direction: column;
    gap: 8em;

    &:before{
        background: url(${SocialBG}) no-repeat;
        background-size: 120%;
        background-position: top center;
        content: "";
        height: 80%;
        left: -5%;
        position: absolute;
        top: 15%;
        right: 20%;
        width: 100%;
        z-index: -1;

        @media (min-width: 768px){
            background-size: 40%;
            background-position: right;
            top: 40%;
        }
    }
`

function Social() {
  return (
    <Container>
        <Social1/>
        <Social2/>
        <Social3/> 
        <Social4/>
    </Container>
  )
}

export default Social
